import Mui from './mui/Mui'
import {ThemeProvider,createTheme} from "@material-ui/core";

const theme = createTheme({
  palette:{
    primary:{
      main:"#03f6cb"
    },
    secondary:{
      main:"#ffa500"
    }
  }
})

render(
  // <BrowserRouter>
